var wellLineReportPage={initialize:function(n){wellLineReportPage.attachEvents(n)},attachEvents:function(n){wellLineReportPage.createFollowUnfollowSymbol();wellLineReportPage.createDatatable();wellLineReportPage.redirectWellDetailsPage(n);wellLineReportPage.setWellFollowUnfollow()},createFollowUnfollowSymbol:function(){$(".i-checks").iCheck({checkboxClass:"icheckbox_square-star",radioClass:"iradio_square-star"})},createDatatable:function(){var n=$("#wellLineReportListTableId").DataTable({columnDefs:[{targets:[0],visible:!1,searchable:!1},{render:function(n,t,i){return n+" ("+i[3]+")"},targets:0},]})},redirectWellDetailsPage:function(n){var t=$("#wellLineReportListTableId").DataTable();$("#wellLineReportListTableId tbody").on("click","tr",function(){$("#processing-modal").modal("show");var i=t.row(this).data();window.location.href=n+"?reportId="+Base64.encode(i[0])})},setWellFollowUnfollow:function(){$(".iCheck-helper").click(function(){var n=$("#followCheckDiv").find("div").hasClass("checked");$("#processing-modal").modal("show");$.ajax({type:"GET",dataType:"text",url:"/WellLineReport/Follow",data:{isFollow:n},cache:!1,success:function(){$("#processing-modal").modal("hide")},error:function(){$("#processing-modal").modal("hide")}})})}};